import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <main>
        <section>
          <input type="email" name="input-email" data-testid="email-input" />
          <input type="text" name="input-password" data-testid="password-input" />
        </section>
        <section>
          <button type="button"></button>
        </section>
      </main>
    );
  }
}

export default Login;
